@-moz-document domain("www.twitch.tv") {
.prime-offers,
.video-chat__header,
.stream-chat-header,
.channel-leaderboard,
.video-chat__message-menu,
.video-chat__input,
.rooms-header,
.channel-points-reward-line > .tw-c-text-alt-2,
.community-highlight-stack__card,
.vod-message__header,
img.chat-badge,
a.tw-button-icon[href^="/moderator/"] {
    display: none !important;
}
.chat-line__message span,
.vod-message a,
.vod-message span,
.tw-textarea,
.chat-line__message--link,
.tw-inline-flex {
    font-size: 17px !important;
}
.chat-line__message--link,
.mentioning {
    word-break: break-all !important;
}
span.chat-author__display-name {
    font-weight: 100 !important;
